import React, { useState, useEffect } from 'react';
import { Select, MenuItem } from '@material-ui/core';
import { VeterinariansApiFactory } from '../json/api.ts';

interface Post {
    id: string;
    name: string;
}

const [selectedValue, setSelectedValue] = useState('');
const SelectVeter: React.FC = () => {
    const [name, setName] = useState<string[]>([]);
    const [data, setData]: any = useState<Post[]>([]);
    const [selectedName, setSelectedName] = useState<string | undefined>();
    const functionFromApi = VeterinariansApiFactory();

    async function getVetDataFromApi() {
        const response = await functionFromApi.apiVeterinariansGet();
        const { data } = response;
        setData(data);
    }

    useEffect(() => {
        getVetDataFromApi();
    }, []);

    

    const handleNameChange = (event: React.ChangeEvent<{ value: unknown }>) => {
        const selectedValue = event.target.value as string;
        console.log('selectedValue');
        setSelectedName(selectedValue);
    };
    return (
        <Select value={selectedName} onChange={(e) => setSelectedValue(e.target.value)}>
        {data.map((post) => (
            <div key={post.id}>
            <MenuItem value={post.name}>{post.name}</MenuItem>
            </div>
        ))}
        </Select>
    );
};

export default SelectVeter;
